script: |
  super -f text -I q13069.spq | sort > q13069.out

inputs:
  - name: q13069.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE - + ( col1 ) NOT BETWEEN 99 / + col1 AND 50 * - col2 * + 85 * col1 + + + col1 * - col2 * + - col0;
  - name: tab1

outputs:
  - name: q13069.out
    data: |
      51	14	96
      85	5	59
      91	47	68
